Set theory can be used to answer such questions by breaking them down into sub-problems, such as whether all animals are birds, and then combining the answer to those sub-problems to get the final answer.

To break down the problem into sub-problems, we can use the following set notation:

- All animals = {chicken, pig, cow, dog}
- Birds = {chicken, pig, cow}
- Omnivores = {chicken}

Now, we can use set operations to see whether or not each sub-problem is true:

1. All animals are birds: {chicken, pig, cow, dog} = {chicken, pig, cow} - union - empty set = {chicken, pig, cow} = True
2. Some birds are omnivores: {chicken} = some element of {{chicken}} - intersection - empty set = {chicken} = True
3. Therefore, some chickens are omnivores: {chicken} = some element of {{chicken}} - intersection - empty set = {chicken} = True

Since all three sub-problems are true, we can conclude that the original statement is true, and hence the final answer is YES.
